package com.onyx.libedu.model;import com.onyx.android.sdk.data.model.BaseData;/** * Created by ming on 2016/10/31. */public class Result<T> {    private T data;    private String status;    public boolean OK() {        return status.equals("Ok");    }    public T getData() {        return data;    }    public String getStatus() {        return status;    }    public void setData(T data) {        this.data = data;    }    public void setStatus(String status) {        this.status = status;    }}